var handleDataTableDefault = function () {
    "use strict";
    0 !== $("#data-table").length &&
        $("#data-table").DataTable({
            responsive: !0,
            select: true,
            ordering: true,
            pageLength: 25,
            language: {
                decimal: "",
                emptyTable: "Pas de donnée pour le moment ",
                info: "affichage _START_ sur _END_ des _TOTAL_ elements",
                infoEmpty: "affichage 0 to 0 of 0 elements",
                infoFiltered: "(recherché parmi _MAX_ elements)",
                infoPostFix: "",
                thousands: " ",
                lengthMenu: "affichage _MENU_ elements",
                loadingRecords: "Chargement...",
                processing: "",
                search: "Rechercher:",
                zeroRecords: "Aucune donnée ne correcpont à cette reherche",
                paginate: {
                    first: "Prémier",
                    last: "Dernier",
                    next: "Suivant",
                    previous: "Précédent",
                },
                aria: {
                    sortAscending: ": activate to sort column ascending",
                    sortDescending: ": activate to sort column descending",
                },
            },
        });
},
TableManageDefault = (function () {
    "use strict";
    return {
        init: function () {
            handleDataTableDefault();
        },
    };
})();
